import styled from "styled-components";

export const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  max-width: auto;
  gap: 1rem;
  font-family: Arial, Helvetica, sans-serif;
`;
export const Items = styled.div`
  display: flex;
  flex-direction: column;
  padding: 20px;
`;
